import { Link } from "react-router-dom";

function HomeCard({bgCol, children}){
    return <div style={{
        width:"100%",
        backgroundColor:bgCol,
        borderRadius:"10px",
        alignItems:"center",
        marginTop:"10px",
    }}>
        {children}

    </div>
}

function Home(){
    return <div style={{display:"flex", flexDirection:"column", alignItems:"center", padding:"0", margin:"0"}}>

        <h1>NTU Artificial Intelligence & Machine Learning Club</h1>

        <HomeCard bgCol="rgb(104, 207, 255)">
            <h2 style={{alignContent:"center"}}>Who are we?</h2>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
        </HomeCard>

        <HomeCard bgCol="rgb(65, 175, 226)">
            <h2>What do we do?</h2>
            <Link to="/Events" style={{
                width:"100%",
                border:"5px solid",
                borderRadius:"30px",
                paddingLeft:"10px",
                paddingRight:"10px",
                textDecoration:"none",
                }}>
                <h2>Check out our upcoming events</h2>
            </Link>
        </HomeCard>



        <h2>How to contact and join the club</h2>
    </div>
}

export default Home;
